INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в процессе проведения психологического вмешательства с использованием индивидуальных, групповых и семейных методов?', 313);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы работать в научной сфере, промышленности или инженерии, связанных с материаловедением и технологиями материалов?', 211);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы научиться ориентироваться на местности, определять координаты геологических объектов, горных выработок и скважин?', 312);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы составлять карты и разрезы геологического содержания?', 312);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы разрабатывать геолого-генетические, прогнозно-поисковые и геолого-промышленные модели месторождений полезных ископаемых различных видов?', 312);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы проводить опробование полезных ископаемых и вмещающих их пород, горных пород, воды и прочего в различной природной обстановке?', 312);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы выделять перспективные площади и участки для поиска и оценки различных видов полезных ископаемых?', 312);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в обеспечении информационной и юридической поддержки в работе органов местного, регионального и федерального управления?', 314);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в обеспечение эффективной и устойчивой работы различных государственных структур и органов местного самоуправления?', 314);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы организовывать взаимодействие государственных и/или муниципальных управлений с общественностью, средствами массовой информации, различными общественными и некоммерческими организациями?', 314);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы принимать участие в принятии управленческих решений по вопросам функционирования органов государственного и муниципального управления, в разработке бюджетов, формировании расходных и доходных частей?', 314);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в контроле за соблюдением законности, обеспечением работы в рамках правовой базы органов местного и государственного управления?', 314);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы  защищать экономические интересы коммерческих организаций и государства?', 315);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы знать налоговое законодательство, уметь анализировать экономические риски и разрабатывать меры по их предотвращению?', 315);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы планировать бюджет, составлять и контролировать сметы, планировать и проводить финансовый контроль, осуществлять контрольно-ревизионные мероприятия?', 315);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы обеспечивать предупреждение, выявление, пресечение, раскрытие и расследование экономических и налоговых преступлений?', 315);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы заниматься анализом экономической информации, прогнозированием развития экономических процессов организации?', 315);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы заниматься рассмотрением дел и разрешением споров, отнесенных к компетенции судов, посредством гражданского, административного и уголовного судопроизводства?', 316);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы заниматься разработкой нормативных правовых актов, консультированием?', 316);
