INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы уметь определять различные виды нарушений законности, разграничивать различные виды правонарушения, определять их объект, субъект, объективную и субъективную стороны?', 316);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы готовить правовую позицию по юридическим делам и отстаивать её публично, в том числе поддерживать государственное обвинение в суде?', 316);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы заниматься рассмотрением дел и разрешением споров, отнесенных к компетенции судов, посредством гражданского, административного и уголовного судопроизводства?', 318);
