INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы принимать участие в обеспечении дипломатических и иных контактов с зарубежными странами и регионами?', 259);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы осуществлять профессиональный письменный перевод официальной и деловой документации?', 259);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы осуществлять протокольное сопровождение официальных лиц и устного перевода выступлений по вопросам, касающимся торгово-экономической и общественно-политической проблематики?', 259);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы вести базы данных по различным аспектам социально-политического и экономического развития зарубежных стран и регионов?', 259);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы готовить информационные материалы для продвижения интересов российских организаций за рубежом, на русском и иностранных языках, а также на языке (языках) региона специализации?', 259);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы изучать современные технические средствами, применять их для создания медиапродуктов, доносить через них определенную позицию, формировать общественное мнение?', 268);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы обеспечивать межкультурное общение в различных профессиональных сферах, выполнять функций посредника в сфере межкультурной коммуникации для достижения максимального коммуникативного эффекта?', 279);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в составлении словников, методических рекомендаций в профессионально-ориентированных областях перевода?', 279);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы принимать участие в деловых переговорах, конференциях, симпозиумах, семинарах с использованием нескольких рабочих языков?', 279);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы осуществлять апробацию (экспертизу) программных продуктов лингвистического профиля?', 279);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы участвовать в проведении эмпирических исследований проблемных ситуаций и диссонансов в сфере межкультурной коммуникации?', 279);
INSERT INTO public.questions (questions, program_id) VALUES ('Хотели бы Вы заниматься организацией занятий по физкультуре с детьми разного возраста, разработкой программы занятий и учебные планы?', 145);
